/*Table structure for table `calon_mahasiswa_copy` */

DROP TABLE IF EXISTS `calon_mahasiswa_copy`;

CREATE TABLE `calon_mahasiswa_copy` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `tanggal_register` datetime DEFAULT NULL,
  `nama` varchar(255) DEFAULT '',
  `tempat_lahir` varchar(255) DEFAULT '',
  `tgl_lahir` date DEFAULT '0000-00-00',
  `jenis_kelamin` enum('L','P') NOT NULL,
  `email` varchar(255) DEFAULT '',
  `password` varchar(255) DEFAULT NULL,
  `propinsi_id` int(5) DEFAULT NULL,
  `kota_kab_id` int(5) DEFAULT NULL,
  `kodepos` char(255) DEFAULT '',
  `alamat` text,
  `telp` char(255) DEFAULT '',
  `jenjang_pendidikan_id` int(5) DEFAULT NULL,
  `jenis_pendaftaran_id` int(10) unsigned NOT NULL DEFAULT '0',
  `asal_sekolah` varchar(255) DEFAULT NULL,
  `asal_universitas` varchar(255) DEFAULT NULL,
  `transkrip_nilai` decimal(3,2) DEFAULT NULL,
  `skhu` decimal(3,2) DEFAULT NULL,
  `programstudi_kode` char(10) NOT NULL DEFAULT '0',
  `status_pmb` enum('lulus','gagal','daftar') NOT NULL DEFAULT 'daftar',
  `status_registrasi` enum('registrasi','confirmed','banned') DEFAULT 'registrasi',
  PRIMARY KEY (`id`),
  KEY `programstudi_kode` (`programstudi_kode`),
  KEY `jenis_kelamin_id` (`jenis_kelamin`),
  KEY `pilih_jenis_pendaftaran_id` (`jenis_pendaftaran_id`),
  KEY `status_pmb_id` (`status_pmb`)
) ENGINE=InnoDB AUTO_INCREMENT=72 DEFAULT CHARSET=latin1;

/*Data for the table `calon_mahasiswa_copy` */

