/*Table structure for table `matakuliah` */

DROP TABLE IF EXISTS `matakuliah`;

CREATE TABLE `matakuliah` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `fakultas_kode` char(10) NOT NULL DEFAULT '',
  `programstudi_kode` char(10) NOT NULL DEFAULT '',
  `dosenkoordinator_id` int(10) unsigned NOT NULL DEFAULT '0',
  `nama` varchar(255) DEFAULT '',
  `karyawan_id` int(10) unsigned NOT NULL DEFAULT '0',
  `semester` tinyint(1) NOT NULL DEFAULT '0',
  `keterangan` text,
  PRIMARY KEY (`id`),
  KEY `fakultas_kode` (`fakultas_kode`),
  KEY `programstudi_kode` (`programstudi_kode`),
  KEY `dosenkoordinator_id` (`dosenkoordinator_id`),
  KEY `karyawan_id` (`karyawan_id`)
) ENGINE=InnoDB AUTO_INCREMENT=67 DEFAULT CHARSET=latin1;

/*Data for the table `matakuliah` */

insert  into `matakuliah`(`id`,`fakultas_kode`,`programstudi_kode`,`dosenkoordinator_id`,`nama`,`karyawan_id`,`semester`,`keterangan`) values (1,'FIK','FIK-TI',1,'FISIKA I\r\n',5,1,'Sistem operasi (bahasa Inggris: operating system ; OS) adalah seperangkat program yang mengelola sumber daya perangkat keras komputer, dan menyediakan layanan umum untuk aplikasi perangkat lunak. Sistem operasi adalah jenis yang paling penting dari perangkat lunak sistem dalam sistem komputer. Tanpa sistem operasi, pengguna tidak dapat menjalankan program aplikasi pada komputer mereka, kecuali program aplikasi booting.'),(2,'FIK','FIK-TI',1,'TATA TULIS KARYA ILMIAH\r\n',7,1,'Tata tulis karya ilmiah ini akan mencakup penjelasan mengenai :\r\n1. Pendahuluan\r\n2. Tujuan\r\n3. Bagan Tulisan Ilmiah\r\n4. Petunjuk Umum Penulisan Karya Tulis Ilmiah\r\n5. Tata Tulis secara Umum'),(3,'FIK','FIK-TI',1,'DASAR PEMROGRAMAN\r\n',8,1,'Matakuliah ini membahas tentang tahapan pemrograman komputer terstruktur dan struktur logika dasar dalam pemrograman terstruktur untuk membuat algorithma pemrograman komputer terkait dengan persoalan komputasi matematika. Fokus matakuliah ini adalah bahasan tentang elemen dasar pemrograman terstruktur dan aplikasinya dalam penyusunan algorithma pemrograman komputer untuk berbagai komputasi matematik. Disamping itu juga diperkenalkan konversi dari algorithma ke kode bahasa pemrograman komputer tertentu seperti bahasa pemrograman Java.'),(4,'FIK','FIK-TI',2,'BAHASA INGGRIS I\r\n',9,1,''),(5,'FIK','FIK-TI',2,'AUDIO FOR MULTIMEDIA\r\n',10,1,''),(6,'FIK','FIK-TI',3,'KALKULUS I\r\n',11,1,''),(7,'FIK','FIK-TI',3,'FISIKA II\r\n',12,2,''),(8,'FIK','FIK-TI',4,'PENGANTAR RANGKAIAN ELEKTRIK\r\n',13,2,'Mata kuliah rangkaian elektronika akan membahas topik-topik meliputi: teori-teori dasar elektronika, pengenalan komponen-komponen sederhana seperti dioda, trioda, transistor, rangkaian-rangkaian elektronika sederhana, pengukuran dan teknik pengukuran, dan piranti komputer.'),(9,'FIK','