/*Data for the table `pengumuman_info` */

insert  into `pengumuman_info`(`id`,`tgl_kegiatan`,`jam`,`judul`,`deskripsi`,`karyawan_id`) values (2,'2013-05-17','10:15:00','sayembara karya tulis ','sayembara nasional dalam bentuk karya tulis mengenai otonomi daerah yang dapat diikuti dosen dan mahasiswa S2, S3 seluruh wilayah Indonesia, pengumuman resmi dapat diunduh di menu download',2),(3,'2013-05-22','13:58:00','Pengumuman Lulus Calon Mahasiswa ','Pengumuman kelulusan calon mahasiswa Program Pascasarjana MTI dan MM tahun akademik 2012-2 dapat di unduh di menu download\r\n\r\nCalon mahasiswa yang dinyatakan lulus dapat membayarkan biaya tahap pertama melalui bank yang daftarnya dapat di unduh di menu download, paling lambat tanggal 28 Maret 2013.\r\n\r\nPrapasca MTI dilaksanaan tanggal 13 April 2013, jadwal dapat diunduh di menu jadwal.\r\n\r\nJadwal Prapasca MM  menyusul.',2),(4,'2013-05-27','17:11:00','Pengumuman Wisdua 46','Pendafataran wisuda dilaksanakan secara online melalu: dinus.ac.id/wisuda\r\nPengumpulan berkas dimulai pada tanggal 1 Maret 2013 sampai dengan tanggal 8 Maret 2013 jam kerja (07.00 s/d 16.00) di Biro Akademik (BIAK) gedung A.\r\nWisuda dilaksanakan pada hari Rabu 27 Maret 2013, tempat di Patra Semarang Convention Hotel\r\n\r\n',2),(5,'2013-05-03','19:11:00','rencana jadwal seminar proposal tesis kelas jabar 2 ','Rencana Seminar Proposal Tesis MTI kelas jabar 2 dilaksanakan mulai tgl 10 Januari 2013',2);

